VALUES
	(1,NULL,81,1637398387,1637398387,2,0,0,0,0,'',256,0,0,0,0,NULL,2,X'7B22626F647974657874223A22227D',0,0,0,0,'text','Runs everywhere','center','<p class=\"text-center\">You can install TYPO3 by downloading <a href=\"https://get.typo3.org/\">with or without&nbsp;composer</a>. Putting it on a web server or on a cloud service like Microsoft Azure or Amazon AWS&nbsp;is simple - due to proper separation of content, configuration and other assets like caches and temporary files.&nbsp;Use any database you like&nbsp;MySQL/MariaDB, postgreSQL, SQL Server or SQLite - due to the underlying database abstraction.</p>\n<p class=\"text-center\"><a class=\"btn btn-secondary\" href=\"https://docs.typo3.org/Home/GettingStarted.html\">Read TYPO3 Install Guide</a></p>',0,0,0,0,0,0,25,1,0,0,0,'default',0,'','','','',0,'','',0,'2','',1,0,'',0,'','','',0,0,0,NULL,'',0,'','','',NULL,124,0,0,0,0,'0',1,'','1.3333333333333',10,'','','','default','','','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'default','none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),
