	(9,NULL,80,1637398387,1637398387,2,0,0,0,0,'',256,0,0,0,0,NULL,0,X'7B226261636B67726F756E645F696D6167655F6F7074696F6E73223A22227D',0,0,0,0,'textpic','Fluid: Next Generation Templating','','<p class=\"lead\">Fluid - TYPO3\'s next generation templating engine - is used for creating custom extension templates.</p>\n<p>Fluid\'s approach to creating templates emphasizes simplicity, flexibility, extensibility, and easy of use. The syntax is XML-based and can be used in any Web IDE. With its ViewHelpers, Fluid can be extended by powerful functionality that fits custom web project needs.</p>',0,0,0,0,1,0,126,1,0,0,0,'default',0,'','','','',0,'','',0,'2','',1,0,'',0,'','','',0,0,0,NULL,'',0,'','','',NULL,124,0,0,0,0,'0',9,'','1.3333333333333',10,'','','','default','','','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'default','none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n                <field index=\"behaviour\">\n                    <value index=\"vDEF\">cover</value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),
	(10,NULL,80,1637398387,1637398387,2,0,0,0,0,'',128,0,0,0,0,NULL,0,X'7B22626F647974657874223A22227D',0,0,0,0,'textpic','Add functionality to the core system','','<p>There are more than 1,500 extensions available in the TYPO3 Extension Repository (TER) on TYPO3.org for you to browse and assess according to your needs. Download and install them directly with the TYPO3 backend Extension Manager. And TYPO3 is open source! You and your developers (or <a href=\"https://typo3.com/services/find-a-typo3-partner/\">your TYPO3 service provider</a>) can also create new, custom extensions to meet your specialised needs.</p>\n<ul class=\"list-inline\"> 	<li><a class=\"btn btn-secondary\" href=\"https://packagist.org/explore/?type=typo3-cms-extension\" target=\"_blank\">Packagist</a></li> 	<li><a class=\"btn btn-primary\" href=\"https://extensions.typo3.org/\" target=\"_blank\">TYPO3 Extension Repository</a></li> </ul>\n\n',0,0,0,0,1,0,125,1,0,0,0,'default',0,'','','','',0,'','',0,'2','',1,0,'',0,'','','',0,0,0,NULL,'',0,'','','',NULL,124,0,0,0,0,'0',10,'','1.3333333333333',10,'','','','default','','','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'default','none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n                <field index=\"behaviour\">\n                    <value index=\"vDEF\">cover</value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),
	(11,NULL,80,1637398387,1637398387,2,0,0,0,0,'',64,0,0,0,0,NULL,0,X'7B226261636B67726F756E645F696D6167655F6F7074696F6E73223A22227D',0,0,0,0,'text','Incredible flexible','center','<p class=\"lead text-center\">Whether you need a blog, feedback forms, an online shop, integrations with external web services, calendars, and much more ... extensions give you a wide range of flexibility to go beyond core functionality, growing your site hand-in-hand as your business and site grow. They are the ideal building block for creating complex online solutions.</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','','','',0,'','',0,'100','',1,0,'',0,'','','',0,0,0,NULL,'',0,'','','',NULL,124,0,0,0,1,'0',11,'','1.3333333333333',10,'','','','default','','','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'default','primary',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),
