ode> markup used for the term being defined)</li>\n    <li> this is <em>very</em> simple (<code>em</code> markup used for emphasizing a word)</li>\n\n    <li> type <kbd>yes</kbd> when prompted for an answer (<code>kbd</code> markup used for text indicating keyboard input)</li>\n    <li> <q>Hello!</q> (<code>q</code> markup used for quotation)</li>\n\n    <li> He said: <q>She said <q>Hello!</q></q> (a quotation inside a quotation)</li>\n    <li> you may get the message <samp>Core dumped</samp> at times (\n        <code>samp</code> markup used for sample output)</li>\n\n    <li> <strong>this is highlighted text</strong> (<code>strong</code> markup used)</li>\n\n    <li> <tt>text in monospace font</tt> (<code>tt</code> markup used)</li>\n\n    <li> the command <code>cat</code> <var>filename</var> displays the file specified by the <var>filename</var> (<code>var</code>        markup used to indicate a word as a variable).</li>\n    <li> In order to test how subscripts and superscripts (<code>sub</code> and <code>sup</code> markup) work inside running text,\n        we need some dummy text around constructs like x<sub>1</sub> and H<sub>2</sub>O (where subscripts occur). So here\n        is some fill so that you will (hopefully) see whether and how badly the subscripts and superscripts mess up vertical\n        spacing between lines. Now superscripts: M<sup>lle</sup>, 1<sup>st</sup>, and then some mathematical notations: e<sup>x</sup>,\n        sin<sup>2</sup> <i>x</i>, and some nested superscripts (exponents) too: Lorem ipsum dolor sit amet, consectetuer\n        adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat. Ut wisi enim\n        ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl ut aliquip ex ea euismod tincidunt\n        ut laoreet dolore magna aliquam erat volutpat. </li>\n\n</ul>\n\n<p>Some of the elements tested above are typically displayed in a monospace font, often using the <em