	(226,'',1,1637398387,1637398387,2,0,0,0,0,'',2,0,0,0,0,NULL,0,X'7B226261636B67726F756E645F696D6167655F6F7074696F6E73223A22227D',0,0,0,0,'text','100% free open source software','','<p>We are committed to open source. Safe, reliable, no hidden agenda, no license jungle or legal issues, zero license fees. As a website owner, your investment in a TYPO3 CMS web application customized to perfectly match your requirements means you own your mission critical web infrastructure. No one can take that software back, unilaterally increase your licensing costs, or prevent you from improving and extending it.</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','','','',12,'','',0,'4','',1,0,'',0,'','','',0,0,0,NULL,'',0,'','','',NULL,124,0,0,0,1,'0',226,NULL,'1.3333333333333',10,'','','','default','','','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'default','none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>');
