INSERT INTO `tx_bootstrappackage_card_group_item` (`uid`, `pid`, `tstamp`, `crdate`, `cruser_id`, `deleted`, `hidden`, `starttime`, `endtime`, `sorting`, `sys_language_uid`, `l10n_parent`, `l10n_diffsource`, `t3ver_oid`, `t3ver_wsid`, `t3ver_state`, `t3ver_stage`, `t3_origuid`, `l10n_state`, `tt_content`, `header`, `subheader`, `image`, `bodytext`, `link`, `link_title`, `link_icon_set`, `link_icon_identifier`, `link_icon`, `link_class`, `t3ver_id`, `t3ver_label`, `t3ver_count`, `t3ver_tstamp`, `t3ver_move_id`)
VALUES
	(1,81,1637398387,1637398387,2,0,0,0,0,6,0,0,X'7B2274745F636F6E74656E74223A22227D',0,0,0,0,0,NULL,4,'On-page Search Engine Optimization (SEO)','',0,'<p>A major part of getting on-page SEO right is consistency. With TYPO3 you can optimize for search engines on the go as you create individual pages with features like URL structure, page titles, and headers. It also allows you to quickly add your own meta description and meta tags.</p>','','','','',0,'default',0,'',0,0,0),
	(2,81,1637398387,1637398387,2,0,0,0,0,5,0,0,X'7B2274745F636F6E74656E74223A22227D',0,0,0,0,0,NULL,4,'Content history and auditing','',0,'<p>TYPO3 CMS keeps a full, unlimited, auditable history of content publication and revision. Browse all changes in a visual data comparison via diff and selectively undo, or even undelete!</p>','','','','',0,'default',0,'',0,0,0),
	(3,81,1637398387,1637398387,2,0,0,0,0,4,0,0,X'7B2274745F636F6E74656E74223A22227D',0,0,0,0,0,NULL,4,'Mobile apps, responsive sites','',0,'<p>Use TYPO3 CMS as the content management, business logic, and content provider for native mobile applications and front-end frameworks, as well as fully-responsive websites for website visitors and admins.</p>','','','','',0,'default',0,'',0,0,0),
	(4,81,1637398387,1637398387,2,0,0,0,0,3,0,0,X'7B2274745F636F6E74656E74223A22227D',0,0,0,0,0,NULL,4,'Any data, any source','',0,'<p>The TYPO3 CMS file system abstraction layer can use and combine any number of file storage systems and locations while remaining completely transparent to editors. Existing file service integrations include Akamai, Alfresco, SixOMC, Cumulus, QBank DAM, Dropbox, Magento, Bynder, and Amazon S3.</p>','','','','',0,'default',0,'',0,0,0),
	(5,81,1637398387,1637398387,2,0,0,0,0,2,0,0,X'7B2274745F636F6E74656E74223A22227D',0,0,0,0,0,NULL,4,'Multilingual','',0,'<p>Deploy your content (or localised copies of your website in a multisite installation) in 56 languages. TYPO3 CMS websites and multisite installations support a variety of translation and localisation models and workflows.</p>','','','','',0,'default',0,'',0,0,0),
